INSERT INTO `movie` VALUES (18,_binary '',125,'2024-05-23','2024-04-26 10:44:37.287000','Chris Hemsworth, Anya Taylor-Joy','w6a6trpigeyudove60q7','http://res.cloudinary.com/dbxajsljz/image/upload/v1714103077/w6a6trpigeyudove60q7.jpg','FURIOSA: A MAD MAX SAGA','5971bc90-e489-46b4-b87c-2eb976c7a074','https://www.youtube.com/embed/FVswuip0-co?si=_W2v-zKrywgEZE86','37bf49c5-7648-4d64-b603-c848b62c7b79','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','e1d89f34-dc9c-44f2-bae5-a2db8ed50f08','14e1c4f8-61e6-4329-9ed2-850cc87b8bdb','FURIOSA: A MAD MAX SAGA','Thuyết Minh','https://www.youtube.com/embed/FVswuip0-co?si=_W2v-zKrywgEZE86'),(13,_binary '',125,'2024-05-15','2024-04-26 10:42:15.301000','Ryan Reynolds, John Krasinski, Cailey Fleming','jurp3hnynbdrddq4umb6','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102935/jurp3hnynbdrddq4umb6.jpg','IF','5971bc90-e489-46b4-b87c-2eb976c7a074','Một cô gái trẻ trải qua một trải nghiệm khó khăn và sau đó bắt đầu nhìn thấy những người bạn tưởng tượng của mọi người, thứ đã bị bỏ lại phía sau khi chủ nhân của chúng giờ đây đã trưởng thành.','0cbab8e2-9a1e-481b-9512-717df8f671df','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','6fe2cb5e-dee4-4ae1-a3fb-a1507ec2663c','396673f9-1fd9-499f-b017-ecfa0ba774f7','IF','Thuyết Minh','https://www.youtube.com/embed/mb2187ZQtBE?si=K07UJ1zjPef_DSVd'),(18,_binary '',114,'2024-04-19','2024-04-25 16:01:05.472000','Lâm Thanh Nhã, Hữu Châu, Xuân Lan, Thái Hòa, Uyển Ân','hm0oevagz0lgz8bhibac','http://res.cloudinary.com/dbxajsljz/image/upload/v1714035665/hm0oevagz0lgz8bhibac.jpg','CAI-GIA-CUA-HANH-PHUC','c02e2ffe-10a5-4939-bb5f-58c068f62a9f','Bà Dương và ông Thoại luôn cố gắng để xây dựng một hình ảnh gia đình tài giỏi và danh giá trong mắt mọi người. Tuy nhiên dưới lớp vỏ bọc hào nhoáng ấy là những biến cố và lục đục gia đình đầy sóng gió. Nhìn kĩ hơn một chút bức tranh gia đình hạnh phúc ấy.','31cae176-e445-4def-b4b8-a246272341b4','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','cd208250-040f-4945-90b5-7d1fe5870e36','4165ec2e-3a66-4ee7-b857-a5b2c1d19c7f','CÁI GIÁ CỦA HẠNH PHÚC','Phụ Đề','https://www.youtube.com/embed/79BznZKQwIQ?si=SzmsYBGFpB_-lfnr'),(18,_binary '',133,'2024-03-15','2024-04-26 10:24:49.747000','Lee Do-hyun, Choi Min-sik','abyonfj6yqnqd3dhttza','http://res.cloudinary.com/dbxajsljz/image/upload/v1714101889/abyonfj6yqnqd3dhttza.jpg','EXHUMA','df4491ef-064d-498e-8e36-ad8ca386ff28','Một pháp sư được cấp một số tiền lớn để di dời một ngôi mộ. Anh ấy di chuyển cùng với người bạn đồng hành của mình, Ji Gwan.','1eb5f670-7ab8-47f0-8984-c1d0472dcee3','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','08986a66-d483-4d09-8f01-4b13a941530f','672eb6e4-e1bd-4022-a0a3-b3b7d888b5c8','EXHUMA','Phụ Đề','https://www.youtube.com/embed/7LH-TIcPqks?si=PR1xtTvnXBhLYWBL'),(18,_binary '',100,'2024-04-19','2024-04-26 10:37:46.870000','Jun Vũ, Vinh Râu','pphzlggikxvoh43k5lmn','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102666/pphzlggikxvoh43k5lmn.jpg','B4S TRƯỚC GIỜ YÊU','c02e2ffe-10a5-4939-bb5f-58c068f62a9f','Tại một quán bar, một nhóm bạn trò chuyện về quan điểm chuyện yêu.','39462a0d-9715-4e01-9d72-27e3c7924ab0','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','cd208250-040f-4945-90b5-7d1fe5870e36','6e0fbe90-effc-41d9-a891-845b42f7a37f','B4S TRƯỚC GIỜ YÊU','Phụ Đề','https://www.youtube.com/embed/JJ_SyVWN9g0?si=iN_Cp6tp9345Jzcl'),(13,_binary '',110,'2024-05-31','2024-04-26 10:39:58.912000','Hannah Waddingham, Chris Pratt','e82rdnc1khnu0qbbfxyx','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102798/e82rdnc1khnu0qbbfxyx.jpg','THE GARFIELD MOVIE','5971bc90-e489-46b4-b87c-2eb976c7a074','Mèo vàng Garfield siêu quậy quay trở lại trong bộ phim mới nhất. Phim kể về chuyến hành trình lầy lội tràn ngập những tình huống khó đỡ của Garfield từ chú mèo hoang bị bỏ rơi trở thành \"boss\" lười biếng, ham ăn lại vừa ham ngủ.','7438816c-bbf6-43ae-a67b-241d7d8ce35f','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','e1d89f34-dc9c-44f2-bae5-a2db8ed50f08','892331d3-0a24-4719-9cd0-5533411a14ef','THE GARFIELD MOVIE','Phụ Đề','v'),(13,_binary '',95,'2024-04-12','2024-04-26 10:30:49.700000','Nhật Hạ, Baggio Saeti','thg33tqs8fxyhkbgd8ep','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102249/thg33tqs8fxyhkbgd8ep.jpg','ĐÓA HOA MONG MANH','c02e2ffe-10a5-4939-bb5f-58c068f62a9f','Câu chuyện tình yêu của cô gái mồ côi Thạch Thảo với âm nhạc, với hai người đàn ông, và hành trình chống lại căn bệnh quái ác.','9bff2953-ba84-4f73-b463-ccd14cdf31ae','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','b7ea0c9f-1f16-4443-a0ef-9fdd75850269','970c2a78-09b2-45f5-9761-ee9f83fa1c32','ĐÓA HOA MONG MANH','Phụ Đề','<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bcWjxRCELuQ?si=Ke222F7ofNcMSbJj\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>'),(13,_binary '',115,'2024-03-29','2024-04-26 10:28:27.083000','Dan Stevens, Rebecca Hall','rfwuvyfuari0yxgkb9gi','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102107/rfwuvyfuari0yxgkb9gi.jpg','GODZILLA X KONG: THE NEW EMPIRE','5971bc90-e489-46b4-b87c-2eb976c7a074','Kong và Godzilla – hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.','d6edb421-31ea-4110-82cb-4cc61f0972f2','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','2f320ed3-b4ae-454a-b091-3355f365630a','98280524-a745-4cdd-8569-fc3efb59a651','GODZILLA X KONG: THE NEW EMPIRE','Phụ Đề','https://www.youtube.com/embed/qqrpMRDuPfc?si=ez74vTovWrclWUp0'),(18,_binary '',100,'2024-12-01','2024-04-26 10:51:31.141000','Nguyễn Vĩ Mạnh','x8v6iudde5ybddt6fgg5','http://res.cloudinary.com/dbxajsljz/image/upload/v1714103491/x8v6iudde5ybddt6fgg5.jpg','NHÀ GIA TIÊN','178423f1-e1f9-4dfd-a004-5fabafe640aa','Tại sao chúng ta phải cùng nhau gìn giữ căn Nhà Gia Tiên? Vì sao những thế hệ con cháu luôn mất kết nối với ông bà của mình? Con người khi chết sẽ đi về đâu? Tại sao mỗi năm chúng ta phải làm đám giỗ cho người đã khuất?','0cbab8e2-9a1e-481b-9512-717df8f671df','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','08986a66-d483-4d09-8f01-4b13a941530f','af507dcb-36a8-4266-bd49-a90d9727195b','NHÀ GIA TIÊN','Thuyết Minh','https://www.youtube.com/embed/H_3aWgi0Kps?si=Ww-aGK1odZ37e9W7'),(1,_binary '',100,'2024-04-19','2024-04-26 10:35:32.169000','Jacob Tremblay, Jack Dylan Grazer','goicsqcvpn1nmkb1ykva','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102532/goicsqcvpn1nmkb1ykva.jpg','LUCA','178423f1-e1f9-4dfd-a004-5fabafe640aa','\"Mùa Hè Của Luca\" kể về chuyến hành trình của cậu bé Luca tại hòn đảo Portorosso thuộc vùng biển Địa Trung Hải ở Ý tuyệt đẹp. Ở đây cậu đã làm quen và kết thân với những người bạn nhỏ mới và tận hưởng mùa hè đầy nắng, kem Gelato và cả món mì Ý trứ danh.','f9afb360-8543-4fc3-ac8f-832d7631ddeb','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','2f320ed3-b4ae-454a-b091-3355f365630a','b7a8b571-568e-4aa9-89f2-631c573628a9','LUCA','Thuyết Minh','https://www.youtube.com/embed/FzV3gRevq4Q?si=OHwYZsY8_zq_-htt'),(13,_binary '',123,'2024-04-12','2024-04-26 10:33:11.296000','Hứa Quang Hán, Shunsuke Michieda','bmys94rcclb7afx3xgzx','http://res.cloudinary.com/dbxajsljz/image/upload/v1714102391/bmys94rcclb7afx3xgzx.jpg','18X2 BEYOND YOUTHDAY DAYS','df4491ef-064d-498e-8e36-ad8ca386ff28','Một chút thanh xuân nồng nhiệt thêm nhiều chút day dứt về tình đầu tất cả đều có trong Thanh Xuân 18×2: Lữ Trình Hướng Về Em.','ccfb107e-6520-4585-aebd-05f09768f0fe','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','b7ea0c9f-1f16-4443-a0ef-9fdd75850269','c807fc6b-ff69-4d2e-acb2-9fb3fd13f871','18X2 BEYOND YOUTHDAY DAYS','Phụ Đề','https://www.youtube.com/embed/8Pq08VsVUFk?si=zPfTXXIbcdvUMTZW'),(18,_binary '',109,'2024-04-26','2024-04-26 10:53:23.242000','Ma Dong Seok, Kim Min Jae','ueig3ywp3xffnxrqgh6y','http://res.cloudinary.com/dbxajsljz/image/upload/v1714103602/ueig3ywp3xffnxrqgh6y.jpg','THE ROUNDUP: PUNISHMENT','df4491ef-064d-498e-8e36-ad8ca386ff28','Thám tử Ma Seok-do gia nhập Đội điều tra mạng để truy bắt Baek Chang-ki, một cựu lính đánh thuê và là người đứng đầu một tổ chức cờ bạc trực tuyến.','c6ad8d83-a244-4c03-a066-3772e398618f','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','e1d89f34-dc9c-44f2-bae5-a2db8ed50f08','d54f2735-51fd-4d0b-91e2-bb6327816b1a','THE ROUNDUP: PUNISHMENT','Phụ Đề','https://www.youtube.com/embed/GOJwOg7ZcaM?si=m1etOuwMNVYAlGTF'),(18,_binary '',115,'2024-05-24','2024-04-26 10:46:51.108000','Megumi Ohara, Wasabi Mizuta','cey0lppzx3wdbfdipijo','http://res.cloudinary.com/dbxajsljz/image/upload/v1714103210/cey0lppzx3wdbfdipijo.jpg','DORAEMON THE MOVIE: NOBITA\'S EARTH SYMPHONY','e71d3eea-bb0e-49b5-8ee5-d22f7c80fa5c','Doraemon và những người bạn thực hiện chuyến phiêu lưu để gặp gỡ những người bạn mới, kết nối mọi người bằng âm nhạc và cứu thế giới khỏi khủng hoảng.','b69a563a-16c3-423e-8c0d-fd861147b5a0','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','2f320ed3-b4ae-454a-b091-3355f365630a','de2885da-6331-4f8f-9d7a-009a2e4a01c4','DORAEMON THE MOVIE: NOBITA\'S EARTH SYMPHONY','Thuyết Minh','https://www.youtube.com/embed/e9Xpdwb9zFQ?si=5MFS4w85mcnNWL9I'),(18,_binary '',115,'2024-05-31','2024-04-26 10:48:32.411000',' Bhuripat Vejvongsatechavat, Phiravich Attachitsataporn','dnfor0bftalrpnmwo5sm','http://res.cloudinary.com/dbxajsljz/image/upload/v1714103312/dnfor0bftalrpnmwo5sm.jpg','PEE NAK 4','8cb05189-9aa3-4c78-ab55-1b05a12b5469','Ba người bạn thấy mình đang ở một ngôi chùa cổ nằm ở ngoại ô thành phố. Tuy nhiên, ngôi chùa này ẩn chứa một truyền thuyết đáng sợ: bất cứ ai mong muốn được xuất gia làm tu sĩ ở đó đều bị nguyền rủa.','df96d7b8-5428-4582-8dec-bf1707b787ae','c6bcc763-a7b8-4870-b3dd-fc66ab1232fb','6fe2cb5e-dee4-4ae1-a3fb-a1507ec2663c','f312fa52-e194-429c-b412-c3b8d52273f7','PEE NAK 4','Thuyết Minh','https://www.youtube.com/embed/g0xVjv1JYNE?si=IV-04sdJtltVdNfx');
